$(document).ready(function () {
    let $tabContainer = $('.global-tabs');
    let $tabContent = $tabContainer.find('.global-tabs__content');
    let $tabs = $tabContainer.find('.global-tabs__tab');

    /**
     * Function to show and hide tab content
     */
    function _ontabClick() {
        let $tabClicked = $(this);
        $tabs.removeClass('global-tabs__tab--active');
        $tabClicked.addClass('global-tabs__tab--active');
        $tabContent.removeClass('show-content');
        $tabContainer.find('#' + $tabClicked.attr('data-tab-id')).addClass('show-content');
    }

    $tabs.on('click', _ontabClick);
});

