var mapConfig = {
    mapCenterDefault: {
        lat: 34.1561,
        lng: -118.1319
    },
    draggable: true,
    zoom: 12,
    map: null,
    infoWindow: null,
    markers: [],
    // Create an array of alphabetical characters used to label the markers.
    labels: 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz'
};

function initMap() {
    mapConfig.map = new google.maps.Map(document.getElementById('map'), {
        zoom: mapConfig.zoom,
        draggable: mapConfig.draggable
    });
    mapConfig.infoWindow = new google.maps.InfoWindow;

    // drag map event
    google.maps.event.addListener(mapConfig.map, 'dragend', function () {
        getLocationsByPosition(this.getCenter().toJSON());
    });

    // Try HTML5 geolocation.
    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(function (position) {
            var pos = {
                lat: position.coords.latitude,
                lng: position.coords.longitude
            };

            // change map center according to device ip position
            mapConfig.map.setCenter(pos);
            getLocationsByPosition(pos, true);
        }, function () {
            handleLocationError(true, mapConfig.infoWindow, mapConfig.map.getCenter());
        });
    } else {
        // Browser doesn't support Geolocation
        handleLocationError(false, mapConfig.infoWindow, mapConfig.mapCenterDefault);
    }
}


function getLocationsByPosition(pos, needFitBounds) {

    var zipcode = '';
    var locationsArray = [];
    var Street, City, State, PostalCode, CountryCode, Latitude, Longitude;
    var locations = [];
    var topLocations = [];

    var geocoder = new google.maps.Geocoder();
    geocoder.geocode({ 'latLng': pos }, function (results, status) {
        if (status === google.maps.GeocoderStatus.OK) {
            for(var i=0; i < results.length; i++){
                for(var j=0;j < results[i].address_components.length; j++){
                    for(var k=0; k < results[i].address_components[j].types.length; k++){
                        if(results[i].address_components[j].types[k] === "postal_code"){
                            zipcode = results[i].address_components[j].short_name;
                        }
                    }
                }
            }
                $.ajax({
                    type: 'GET',
                            url: "https://mobileapi.locatorsearch.com/LocatorSearchAPI.asmx/FindLocations?UserName=9CAB3FA5&Password=9CAB3FA5-7C6F-4AAE-B24A-B1F970C50457&AddressLine=&City=&State=&Country=&Latitude=&Longitude=&Type=mini3&Offset=&PostalCode=" + zipcode,
                            dataType: 'xml',
                            success: function(xml) {
                                $(xml).find('location').each(function () {

                                    var locObj = {
                                        Street : $(this).find('street').text(),
                                        City : $(this).find('city').text(),
                                        State : $(this).find('state').text(),
                                        PostalCode : $(this).find('zip').text(),
                                        CountryCode : $(this).find('country').text(),
                                        Latitude : $(this).find('lat').text(),
                                        Longitude : $(this).find('long').text(),
                                        LocationName : $(this).find('attribute[key="LocationName"]').text()
                                    };

                                    locationsArray.push(locObj);
                                    topLocations = locationsArray.slice(0,20);
                                    //console.log("" +topLocations);
                                    locations = topLocations;

                                    if (topLocations.length <= 0) {
                                        $('.atm-input-error').html('No results were found near that location.');
                                        $('.locations-container').addClass('one-line-error');
                                        $('.atm-input-error').show();
                                        return;
                                    }
                                });
                                mapConfig.map.setCenter(pos);
                                deleteMarkers();
                                drawMarkers(topLocations, needFitBounds);
                            }
                });
        }
    });
}

function drawMarkers(locations, needFitBounds) {

    var i = 0;
    $('.locations-container').empty();

    // Add some markers to the map.
    // Note: The code uses the JavaScript Array.prototype.map() method to
    // create an array of markers based on a given "locations" array.
    // The map() method here has nothing to do with the Google Maps API.
    //mapConfig.markers = $.each( locations, function( i, location ) {
    mapConfig.markers = locations.map(function (location, i) {

        var locationData = {
            position: {
                lat: parseFloat(location.Latitude),
                lng: parseFloat(location.Longitude)
            },

            infoWindowContent: [
                '<div class="info-box">',
                '<strong class="name">' + location.LocationName + '</strong>',
                '<br />',
                '<span class="line-one">' + location.Street + '</span>',
                '<br />',
                '<span class="city">' + location.City + ', ' + '</span>',
                '<span class="state">' + location.State + '</span>',
                '<span class="zip"> ' + location.PostalCode+ '</span>',
                '</div>'
            ].join(''),
            locationContent: [
                '<div class="location">',
                '<div class="marker">',
                '<div class="marker-icon">' + mapConfig.labels[ i % mapConfig.labels.length] + '</div>',
                '</div>',
                '<div class="location-info">',
                '<div class="name">' + location.LocationName + '</div>',
                '<div class="address">' + location.Street + '</div>',
                '<div class="city-state">' + location.City + ', ' + location.State + ' ' + location.PostalCode + '</div>',
                '</div>',
                '</div>'
            ].join('')
        }

        var marker = new google.maps.Marker({
            position: locationData.position,
            label: mapConfig.labels[i % mapConfig.labels.length],
            map: mapConfig.map
        });

        // register marker click event
        markerOnClick(locationData, marker);

        $('.locations-container').append(locationData.locationContent);

        return marker;
    });

    if (needFitBounds) {
        fitBounds();
    }
}

function fitBounds() {
    if (mapConfig.markers.length > 0) {
        var bounds = new google.maps.LatLngBounds();
        var i;
        for (i = 0; i < mapConfig.markers.length; i++) {
            bounds.extend(mapConfig.markers[i].getPosition());
        }
        mapConfig.map.fitBounds(bounds);
    }
}

function deleteMarkers() {
    for (var i = 0; i < mapConfig.markers.length; i++) {
        mapConfig.markers[i].setMap(null);
    }
    mapConfig.markers.length = 0;
}

function markerOnClick(locationData, marker) {
    marker.addListener('click', function () {
        mapConfig.infoWindow.setContent(locationData.infoWindowContent);
        mapConfig.infoWindow.open(mapConfig.map, marker);
    });
}

function handleLocationError(browserHasGeolocation, infoWindow, pos) {
    infoWindow.setPosition(pos);
    infoWindow.setContent(browserHasGeolocation ?
                            'Error: The Geolocation service failed.' :
                            'Error: Your browser doesn\'t support geolocation.');
    infoWindow.open(mapConfig.map);

    // set default position as center
    var geocoder = new google.maps.Geocoder();
    getLocationsByPosition(mapConfig.mapCenterDefault, true);
}

