	// if input type equal to tel, only allow numbers and dashes
	$("input[type=tel]").on("keypress keyup blur",function (event) {
		$(this).val($(this).val().replace(/[^0-9\-]/g,''));
		if (event.keyCode != 45 && (event.keyCode < 48 || event.keyCode > 57)) {
			event.preventDefault();
		}
	});
	// validaiton functions
	function addEvent(node, type, callback) {
		if (node.addEventListener) {
			node.addEventListener(type, function(e) {
				callback(e, e.target);
			}, false);
		} else if (node.attachEvent) {
			node.attachEvent('on' + type, function(e) {
				callback(e, e.srcElement);
			});
		}
	}
	function shouldBeValidated(field) {
		return (
			!(field.getAttribute("readonly") || field.readonly) &&
			!(field.getAttribute("disabled") || field.disabled) &&
			(field.getAttribute("pattern") || field.getAttribute("required"))
		);
	}
	function instantValidation(field) {
		if (shouldBeValidated(field)) {
			displayErrorMessage(field);
		}
	}

	function displayErrorMessage(field) {
		var invalid_required = field.hasAttribute("required") && !field.value;
		var pattern = field.getAttribute("pattern");
		var invalid_regex = pattern && field.value && !new RegExp(pattern).test(field.value);
		var cmp_form_text = field.closest('.cmp-form-text');
		var required_message = cmp_form_text.querySelector(".error-text__requiredmessage");
		var constraint_message = cmp_form_text.querySelector(".error-text__constraintmessage");
		if (!(invalid_required || invalid_regex)) {
			cmp_form_text.classList.remove('input--error');
			required_message.classList.add("hide--message");
			constraint_message.classList.add("hide--message");
		} else if (invalid_required) {
			cmp_form_text.classList.add('input--error');
			required_message.classList.remove("hide--message");
			constraint_message.classList.add("hide--message");			
		} else if (invalid_regex) {
			cmp_form_text.classList.add('input--error');				
			required_message.classList.add("hide--message");
			constraint_message.classList.remove("hide--message");
		}
		return (invalid_required || invalid_regex);
	}

