$(document).ready(function () {

    window.requestAnimationFrame = window.requestAnimationFrame
    || window.mozRequestAnimationFrame
    || window.webkitRequestAnimationFrame
    || window.msRequestAnimationFrame; 
    // sticky header variables
    var ctaSection = $('.hero, .homepage-hero, .stickyCTA');
    var navSection = document.querySelector('#gd-stickycta-header');
    var ctaTop = $(ctaSection).height();
    var navTop = $(navSection).height();
    var totalTop = navTop + ctaTop;
    var last_known_scroll_position = 0;
    var ticking = false;   

    // cta creation variables
    //todo: add better selections for different environments
    var pdpCTA1 = $('.gd-sticky-buttons__desktop .gd-sticky-buttons__link1 .link-label');
    var pdpCTA2 = $('.gd-sticky-buttons__desktop .gd-sticky-buttons__link2 .link-label');

    var pdpHeroText1 = $(pdpCTA1).text().trim();
    var pdpHeroText2 = $(pdpCTA2).text().trim();
    var pdpHeroLink1 = $('.gd-sticky-buttons__desktop .gd-sticky-buttons__link1 a').attr('href');
    var pdpHeroLink2 = $('.gd-sticky-buttons__desktop .gd-sticky-buttons__link2 a').attr('href');
    // sticky header element creation divs 
    var cta1 = document.querySelector('.gdsticky-cta__cta1');
    var cta2 = document.querySelector('.gdsticky-cta__cta2');
    var ctaStyles = "btn btn--width-medium btn--primary-black-text-outline";

    // document.body.onload = createStickyCtas(ctaStyles, pdpHeroLink1, pdpHeroText1, cta1);
    // document.body.onload = createStickyCtas(ctaStyles, pdpHeroLink2, pdpHeroText2, cta2);

    function createStickyCtas(style, href, content, ele) {
        var newCta = document.createElement("a");
        var newStyles = document.createAttribute('class');
        var newLink = document.createAttribute('href');
        newStyles.value = style;
        newLink.value = href;
        // set the styles from the page
        newCta.setAttributeNode(newStyles);
        // set the href from the page's cta
        newCta.setAttributeNode(newLink);
        // set the text from the page's cta
        var newCtaText = document.createTextNode(content);
        // add the text node to the newly created div
        newCta.appendChild(newCtaText);
        // add the newly created element and its content into the DOM
        if (content != '') {
            ele.appendChild(newCta);
        }
    }
    // function that creates the sticky animation
    function gdStickyHeader(last_known_scroll_position) {
        if (last_known_scroll_position >= totalTop) {
            document.body.classList.add('gd-sticky');
        } else {
            document.body.classList.remove('gd-sticky');
        }
    }
    // checks for scroll, if yes fire sticky header function
    window.addEventListener('scroll', function (e) {
        last_known_scroll_position = window.pageYOffset;
        if (!ticking) {
                window.requestAnimationFrame(function () {
                    gdStickyHeader(last_known_scroll_position);
                    ticking = false;
                });
                ticking = true;
        }
    });
});
(function(GDOT) {

    /**
     * checks if the jquery element is within the viewport range of -200 to
     * @param {object} $elem 
     */
    function _isInViewport($elem, noOffset) {
        noOffset = noOffset || false;
        let viewportTop = noOffset ? $(window).scrollTop() : $(window).scrollTop() - 200;
        let viewportBottom = noOffset ? viewportTop + $(window).height() : viewportTop + $(window).height() + 300;
        let elementTop = $elem.offset().top;
        let elementBottom = elementTop + $elem.outerHeight();
        return (elementTop !== 0 && elementBottom > viewportTop && elementTop < viewportBottom);
    }

    /**
     * Function to load scripts dynamically
     * @param {string} src 
     * @param {function} onloadCallback 
     */
    function _loadScript(src, onloadCallback) {
        const scriptElm = document.createElement('script');
        scriptElm.src = src;
        scriptElm.type = "text/javascript";
        document.head.appendChild(scriptElm);

        if (typeof onloadCallback === 'function') {
            scriptElm.onload = onloadCallback;
        }
    }

    /**
     * Function to detect internet explorer
     */
    function _isInternetExplorer() {
        let ua = window.navigator.userAgent;
        return ((ua.indexOf('MSIE ') > -1) || (ua.indexOf('Trident/') > -1));
    }

    /**
     * @function
     * @desc runs the callback function if page has loaded else binds callback to load event
     * @param {Object} callback | the function that needs to be executed
     */
    function _callOnLoad(callback) {
        if (/complete|interactive|loaded/.test(document.readyState)) {
            callback();
        } else {
            window.addEventListener("load", callback, false);
        }
    }


    // exposed utilities
    GDOT.utilities = {
        isInViewport: _isInViewport,
        loadScript: _loadScript,
        isInternetExplorer: _isInternetExplorer,
        callOnLoad: _callOnLoad
    };

})(window.GDOT || (window.GDOT = {}));
$(document).ready(function () {
    let $footnoteLinks = $('.footnote_link');
    let headerHeight = $('.g2b-header').outerHeight();
    let hasTouch = false;
    let hasMouse = false;

    /**
     * Function to align tooltip horizontally depending on left and right available space
     * @param {Object} $newfootnoteText jquery object of footnote text
     * @param {Object} parentBoundsObj parent bounds object
     * @param {Object} elBoundsObj target element bounds object
     */
    function _alignHorizontal($newfootnoteText, parentBoundsObj, elBoundsObj) {
        let rightOffset = parentBoundsObj.right - elBoundsObj.right,
            leftOffset = elBoundsObj.left - parentBoundsObj.left;

        if (rightOffset < 140) {
            $newfootnoteText.css({ 'left': 'auto', 'right': -rightOffset - 9 });
        } else if (leftOffset < 140) {
            $newfootnoteText.css({ 'right': 'auto', 'left': -leftOffset });
        } else {
            $newfootnoteText.addClass('centered');
        }
    }

    /**
     * Function to align the tooltip vertically
     * @param {Object} alignObj Object containing target element, footnote text jquery object, tooltip initial arrow jquery object and bottom parameter in px
     */
    function _alignVertical(alignObj) {
        if (alignObj.$el.hasClass('invert')) {
            alignObj.$newfootnoteText.css('bottom', 'auto');
        } else {
            alignObj.$newfootnoteText.css('bottom', alignObj.bottomPos);
            alignObj.$tooltipArrow.css('bottom', alignObj.bottomPos);
        }
    }

    /**
     * Function checks and prepends new text elem
     * @param {object} $parent parent of the tooltip jquery object
     * @param {object} $tooltipText jquery object containing tooltip text
     */
    function _addNewFootnote($parent, $tooltipText) {
        if (!$parent.find('.footnotes__text').length) {
            let content = $tooltipText.html();
            $parent.prepend('<p class="footnotes__text type-force-wrap">' + content + '</p>');
        }
    }

    /**
     * Function to invert the tooltip depending on the space available
     * @param {Object} $elm Jquery object for the target element 
     * @param {Number} tooltipTextHeight Height of the tooltiptext
     */
    function _invertTooltip($elm, tooltipTextHeight) {
        if ($elm.offset().top - $(window).scrollTop() - headerHeight < tooltipTextHeight + 30) {
            $elm.addClass('invert');
        } else {
            $elm.removeClass('invert');
        }
    }

    /**
     * Function called on hover in and click for all viewports
     */
    function _tooltipHoverHandler() {
        let $elm = $(this);
        $elm.closest('.gd-content-card').addClass('overflow-visible');
        $elm.closest('.gd-table__container').addClass('overflow-visible');

        if (!$elm.closest('.footnote_link').hasClass('show-tooltip')) {
            _invertTooltip($elm, $elm.find('.footnotes_tooltiptext')[0].getBoundingClientRect().height);
        }
    }

    /**
     * Function called on hover out
     */
    function _tooltipHoverOutHandler() {
        let $elm = $(this);
        $elm.closest('.gd-content-card').removeClass('overflow-visible');
        $elm.closest('.gd-table__container').removeClass('overflow-visible');
        $footnoteLinks.removeClass('show-tooltip');
    }

    /**
     * Function called on click of tooltip to display and position tooltip for mobile
     * @param {Object} e  event object passed to function on call
     */
    function _tooltipClickHandler(e) {
        let $el = $(this);
        let $parent = $el.closest('.footnote_link');

        if ($parent.hasClass('show-tooltip')) {
            $footnoteLinks.removeClass('show-tooltip');
        } else if (window.innerWidth < 1144 || window.orientation === 90) {
            let $superParent = $parent.parent();
            let $theadCellParent = $el.closest('.gd-table__head--cell');
            let $tbodyCellParent = $el.closest('.gd-table__cell');
            let $tooltipText = $el.find('.footnotes_tooltiptext')
            let lineheight = parseInt($superParent.css('line-height').replace('px', ''));

            _addNewFootnote($parent, $tooltipText);
            $parent.addClass('show-tooltip');

            let $newfootnoteText = $parent.find('.footnotes__text');
            let $posRelativeEl = $theadCellParent.length ? $el.closest('.gd-table__head') : $tbodyCellParent.length ? $el.closest('.gd-table__row') : $superParent;

            if (window.innerWidth < 768) {
                $newfootnoteText.css({ 'width': 0.8 * window.innerWidth + 'px' });
            }

            _invertTooltip($el, $newfootnoteText[0].getBoundingClientRect().height);
            _alignVertical({
                '$el': $el,
                '$newfootnoteText': $newfootnoteText,
                '$tooltipArrow': $tooltipText,
                'bottomPos': lineheight + 12 + 'px'
            });
            _alignHorizontal($newfootnoteText, $posRelativeEl[0].getBoundingClientRect(), $el[0].getBoundingClientRect());
        }
    }

    /**
     * Initial function for binding tooltip events on page load
     */
    function _initTooltip() {
        if (('ontouchstart' in window) || (navigator.maxTouchPoints > 0) || (navigator.msMaxTouchPoints > 0)) {
            hasTouch = true;
        }
        else {
            hasMouse = true
        }
        if (hasTouch && !hasMouse) {
            $('body').addClass('touch-enabled');
        }

        $('body').on('mouseenter touchstart', '.footnote_link .footnotes_tooltip', _tooltipHoverHandler).on('mouseleave', '.footnote_link .footnotes_tooltip', _tooltipHoverOutHandler).on('click', '.footnote_link .footnotes_tooltip', _tooltipClickHandler);
    }



    _initTooltip();


    var $win = $(window);
    $("a[data-modal-id='video_vimeo']").on('click', function () {
        var currentScrollPos = $win.scrollTop();

        if (currentScrollPos === 0) {
            $win.scrollTop(currentScrollPos + 1);
        } else {
            $win.scrollTop(currentScrollPos - 1);
        }

    })

});
$(document).ready(function() {
    let $readMoreBlock = $('.toggle-readmore');
    let $readmoreLessBtn = $readMoreBlock.find('.toggle-readmore__btn');

    /**
     * Function to hide the content
     * @param {object} $contentBlock - Jquery object
     */
    function _hideContent($contentBlock) {
        let lineHeight = parseFloat($contentBlock.find('p').css('line-height').replace('px', ''));

        if (lineHeight * 3 < $contentBlock.height()) {
            $contentBlock.parents('.toggle-readmore').addClass('readmore-enabled');
            let extHeight = parseInt($contentBlock.css('padding-top').replace('px', '')) + parseInt($contentBlock.css('margin-top').replace('px', ''));
            let fontSize = $contentBlock.find('p').css('font-size');
            $contentBlock.css({ 'max-height': lineHeight * 3 + extHeight });
            $contentBlock.find('.toggle-readmore__ellipsis').css({ 'line-height': lineHeight + 'px', 'height': lineHeight, 'font-size': fontSize });
        }
    }

    /**
     * Function to show the hidden content
     * @param {object} $contentBlock - Jquery object
     */
    function _showContent($contentBlock) {
        $contentBlock.css({ 'max-height': 'none' });
    }

    /**
     * Function called on read more and read less button clicks
     */
    function _readmoreLessHandler() {
        let $blockToToggle = $(this).parents('.toggle-readmore');
        if ($blockToToggle.hasClass('readmore-expanded')) {
            _hideContent($blockToToggle.find('.toggle-readmore__content'));
            $blockToToggle.removeClass('readmore-expanded');
        } else {
            _showContent($blockToToggle.find('.toggle-readmore__content'));
            $blockToToggle.addClass('readmore-expanded');
        }
    }

    /**
     * Initialize all readmore blocks by hiding the content
     */
    function _init() {
        $readMoreBlock.each(function() {
            _hideContent($(this).find('.toggle-readmore__content'));
        });
    }

    /**
     * Initiate Readmore functionality if toggle-readmore element exists
     */
    if ($readMoreBlock.length) {
        $readmoreLessBtn.on('click', _readmoreLessHandler);
        _init();
        // $(window).on('resize', _init);
    }
});
$(document).ready(function() {
    let scaleFactor = 2;
    let $largeImages = $('.image-2x, .image-3x');

    /**
     * Function to reduce the image auto width incase 2x 3x image is authored
     */
    function _updateImageWidth() {
        $largeImages = $('.image-2x:not(".img-updated"), .image-3x:not(".img-updated")');
        $largeImages.each(function() {
            let $updateImg = $(this);
            if (GDOT.utilities.isInViewport($updateImg, true)) {
                setTimeout(function() {
                    let img = new Image();
                    img.src = $updateImg.find('img').attr('src');
                    if (img.width > 0) {
                        scaleFactor = $updateImg.hasClass('image-2x') ? 2 : 3;
                        $updateImg.find('.cmp-image').css({ 'max-width': img.width / scaleFactor, 'margin': 'auto' });
                        $updateImg.addClass('img-updated');
                    }
                }, 10);
            }
        });
    }

    if ($largeImages.length) {
        _updateImageWidth();
        $(window).on("scroll", _updateImageWidth);
    }
});
